import styles from './burger-constructor.module.css';
import { ConstructorElement } from "@ya.praktikum/react-developer-burger-ui-components";



function BurgerConstructor(cards) {
    const datan = cards.cards.cards.slice(0);
    const NewBurger = {
        bun: {"_id":"643d69a5c3f7b9001cfa093c",
                "name":"Краторная булка N-200i",
                "type":"bun","proteins":80,
                "fat":24,
                "carbohydrates":53,
                "calories":420,
                "price":1255,
                "image":"https://code.s3.yandex.net/react/code/bun-02.png",
                "image_mobile":"https://code.s3.yandex.net/react/code/bun-02-mobile.png",
                "image_large":"https://code.s3.yandex.net/react/code/bun-02-large.png","__v":0},
            ingradients: [{"_id":"643d69a5c3f7b9001cfa0941",
                        "name":"Биокотлета из марсианской Магнолии",
                        "type":"main",
                        "proteins":420,
                        "fat":142,
                        "carbohydrates":242,
                        "calories":4242,
                        "price":424,
                        "image":"https://code.s3.yandex.net/react/code/meat-01.png",
                        "image_mobile":"https://code.s3.yandex.net/react/code/meat-01-mobile.png",
                        "image_large":"https://code.s3.yandex.net/react/code/meat-01-large.png","__v":0},
                        {"_id":"643d69a5c3f7b9001cfa093e",
                        "name":"Филе Люминесцентного тетраодонтимформа",
                        "type":"main",
                        "proteins":44,
                        "fat":26,
                        "carbohydrates":85,
                        "calories":643,
                        "price":988,
                        "image":"https://code.s3.yandex.net/react/code/meat-03.png",
                        "image_mobile":"https://code.s3.yandex.net/react/code/meat-03-mobile.png",
                        "image_large":"https://code.s3.yandex.net/react/code/meat-03-large.png","__v":0}]
    }

    
    return(
        <section className={styles.burgerconstructor}>
              <div className="mt-25 pt-4">
                 <ConstructorElement
                 type="top"
                 isLocked={true}
                 text = {NewBurger.bun.name}
                 price= {NewBurger.bun.price}
                 thumbnail={NewBurger.bun.image_mobile}
                />
               </div>
             {NewBurger.ingradients.map((item) =>{
                   
                return (
                <div className="mt-4">   
                    <ConstructorElement
                     
                        text = {item.name}
                        price= {item.price}
                        thumbnail={item.image_mobile}
                    />
                </div>

                        ) } )}
            
                <div className="mb-4 mt-4">
                 <ConstructorElement
                 type="bottom"
                 isLocked={true}
                 text = {NewBurger.bun.name}
                 price= {NewBurger.bun.price}
                 thumbnail={NewBurger.bun.image_mobile}
                 />
                </div>

            
        </section>

    )
};
export default BurgerConstructor;
